import React from "react";
import { customers } from "../../data/mockData";

export default function Customers() {
  return (
    <div>
      <h1>Customers</h1>

      <table className="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Mobile</th>
            <th>Visits</th>
            <th>Total Spend</th>
          </tr>
        </thead>
        <tbody>
          {customers.map((c, index) => (
            <tr key={index}>
              <td>{c.name}</td>
              <td>{c.mobile}</td>
              <td>{c.visits}</td>
              <td>â‚¹{c.total}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
